                s.title = seism.place;
                str = JsonConvert.SerializeObject(s);
                parseS.Add(str);
            }
            seisms = seismsdata;
            seisms.Sort((x, y) => y.dateSeism.CompareTo(x.dateSeism));
            nrEqks = seisms.Count;
            await base.InvokeAsync(StateHasChanged);
            return true;
        }


    

